        Delay1_reg(20 DOWNTO 1) <= Delay1_reg(19 DOWNTO 0);
      END IF;
    END IF;
  END PROCESS Delay1_process;

  Delay1_out1 <= Delay1_reg(20);

  Logical_Operator1_out1 <= FIR_Interpolator_out2 AND Delay1_out1;

