        delayMatch15_reg(0) <= stateControl_18;
        delayMatch15_reg(1) <= delayMatch15_reg(0);
      END IF;
    END IF;
  END PROCESS delayMatch15_process;

  stateControl_19 <= delayMatch15_reg(1);

  enb_gated_6 <= stateControl_19 AND enb;

