  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 20
  count_step <= to_unsigned(16#01#, 8);

  count_from <= to_unsigned(16#00#, 8);

  count_reset <= to_unsigned(16#00#, 8);

  zero_1 <= '0';

  stateControl_28 <= '1';

  delayMatch14_process : PROCESS (clk)
  BEGIN
